import React from 'react'
import Buttons from "./Buttons.styles.jsx"


const ControlButtons = () => { 

    return( 
            <Button>
                <h1>Dji Tello Controller</h1>

                    <buttons>UP</buttons>
                    <buttons>RIGHT</buttons>
                    <buttons>DOWN</buttons>
                    <buttons>LEFT</buttons>
            </Button>
    )

}

export default ControlButtons;
